import path from 'path';

export default async function(page, fileUrl, screenshotsDir) {
  try {
    // Navigate to the HTML file
    await page.goto(fileUrl);
    await page.waitForLoadState('networkidle');

    // Take initial screenshot
    const screenshots = [];
    await page.screenshot({ path: path.join(screenshotsDir, 'step_1_initial.png') });
    screenshots.push(path.join(screenshotsDir, 'step_1_initial.png'));

    // Wait for the search input field and type "music"
    await page.waitForSelector('input.search-input');
    await page.fill('input.search-input', 'music');

    // Take screenshot after typing
    await page.screenshot({ path: path.join(screenshotsDir, 'step_2_after_typing.png') });
    screenshots.push(path.join(screenshotsDir, 'step_2_after_typing.png'));

    // Click the search button
    await page.waitForSelector('button.search-btn');
    await page.click('button.search-btn');

    // Wait for results to load
    await page.waitForLoadState('networkidle');

    // Take screenshot of the results
    await page.screenshot({ path: path.join(screenshotsDir, 'step_3_results_loaded.png') });
    screenshots.push(path.join(screenshotsDir, 'step_3_results_loaded.png'));

    // Click on the first video result
    await page.waitForSelector('.video-item:first-child');
    await page.click('.video-item:first-child');

    // Take final screenshot after clicking the video
    await page.screenshot({ path: path.join(screenshotsDir, 'step_4_video_clicked.png') });
    screenshots.push(path.join(screenshotsDir, 'step_4_video_clicked.png'));

    return {
      success: true,
      action: "Searched for 'music' and clicked on the first video result",
      extractedData: {},
      screenshots,
      error: null
    };
  } catch (error) {
    return {
      success: false,
      action: "Failed to complete task",
      extractedData: {},
      screenshots: [],
      error: error.message
    };
  }
}

